import style from './Preloader.module.css'

const Preloader = (props) => {
    console.log(props)

    return (
        <div>
            { props.isFetching ? 
                <div className={style.ldsRoller}><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div></div>    
            : null }
       </div>
    )}

export default Preloader;
